オールシーズン履けるキャンバススニーカー。人気のローカットタイプがプチプラで登場。コーデに取り入れるだけでこなれた感じをプラスしてくれるのも魅力です。<br>【素材・サイズ感】<br>色違いで揃えたくなるベーシックなカラーを取り揃えました。XS～3Lと豊富な6サイズ展開です。<br>【スタイリング】<br>カジュアルコーデ合わせやワンピースなどのガーリーコーデのはずしアイテムとしても◎系統問わずに合わせやすい万能アイテムです。素材が柔らかく軽いため、アウトドアシーンでも履いていただけます。<br><hr><br>※キャンセル/変更不可<br>【サイズ】<br>XS:22.0-22.5/S:22.5-23.0/M:23.0-23.5/L:23.5-24.0/LL:24.0-24.5/3L:24.5-25.0<br>【実寸(cm)約】<br>●サイズ…XS/S/M/L/LL/3L<br>●筒丈…4.5/4.9/5.2/5.3/5.4/5.5<br>●足幅…7.3/7.5/7.7/7.8/8/8.2<br>●つま先口…8.7/8.8/8.8/8.9/9/9<br>●甲幅…11.2/11.3/11.3/11.3/11.4/11.4<br>●ソール高さ…2.5<br>●前高さ…2.5<br>●重さ…片足 M 310g<br>【素材】<br>キャンバス生地<br>※【伸縮】なし/【淡色透け】なし/【濃色透け】なし /【裏地】あり<br><br><br><style type="text/css">
