配色がかわいいローカットスニーカー◎ライナークッションも効いていて歩きやすさもバツグン！<br>【素材・サイズ感】<br>S～LLの４サイズ展開に派手になりすぎないカラー切り替えとシンプルなホワイトスニーカーの4type。<br>【スタイリング】<br>柄の切り替えがコーデの邪魔をしないアクセントに！合皮素材で大人っぽく使えるローカットスニーカー◎大人のカジュアルコーデにぴったりのアイテム！※柄生地は、総柄のため柄の見え方が一点一点異なります。<br><hr>◆MODEL(163cm:ホワイト×シルバー・S着)<br>┗コーデITEM:トップス/ボトムス/バッグ<br>※キャンセル/変更不可<br>【サイズ】<br>S:22.5-23.0/M:23.0-23.5/L:23.5-24.0/LL:24.0-24.5<br>【実寸(cm)約】<br>●サイズ…S/M/L/LL<br>●筒丈…5/5.2/5.2/5.4<br>●足幅…7.2/7.4/7.6/7.8<br>●つま先口…7.5/7.7/7.9/8.1<br>●甲幅…15/15.2/15.4/15.6<br>●ソール高さ…2.5<br>●前高さ…2.5<br>●重さ…片足 M 270g<br>【素材】<br>合成皮革<br>※【伸縮】なし/【淡色透け】なし/【濃色透け】なし /【裏地】あり<br><br><br><style type="text/css">
